import Login from '../views/login/login'
import Home from '../views/home/home'

let routes = [
    {
        path: '/login',
        name: '登录',
        exact: true,
        component: Login
    },
    {
        path: '/home',
        name: '首页',
        exact: true,
        component: Home
    },
]
export default routes;
